@extends('layouts.app')
@section('title', '防災士培訓')
@section('subtitle', '進階防災士統計')

@section('content')
<div x-data="{
    typeSelector:'total',
    counts:{{ json_encode($counts) }},
    setColor(){
        for(const [cityCode,oneCity] of Object.entries(this.counts)){
            let countNum=oneCity[this.typeSelector];
            let className = countNum >= 3000 ? 'dp-500-999' : (countNum >= 1000 ? 'dp-200-499' : (countNum >= 500 ? 'dp-100-199' : (countNum >= 200 ? 'dp-50-99' : (countNum > 0 ? 'dp-0-49' : 'fill-white'))));
            document.querySelector('svg #' + cityCode).classList = cityCode + ' ' + className;
        }
    },
    setType(e){
        this.typeSelector=e.target.dataset.type;
        this.setColor();
    }
}" id="primary" class="flex flex-row items-start justify-center w-full px-4 py-8" x-init="$nextTick(() => {
    setColor();
})">
